import React from "react";

function Card(props) {
  const cardStyle = {
    backgroundImage: `url(${props.img}) `,
    backgroundSize: "cover",
    backgroundPosition: "center",
    color: "white",
    height:"20em",
    margin:"1em",
    borderRadius:".8em"
  }
  return (
    <div
      style={cardStyle}
      className="category-card d-flex flex-column justify-content-center p-3"
    >
      <h4>{props.title}</h4>
      <p>{props.description}</p>
    </div>
  );
}

export default Card;
